import React from 'react'
import Time from './components/Time';
import Weather from './components/Weather';
import Date from './components/DateToday';
function App() {
  return (
    <div>
     <h1>Hello World</h1>
     <Weather/>
     <Time/>
     <Date/>
    </div>
  );
}

export default App;
